   const interpolationPrecision: number = 40 // Adjust 20 for more/less points

   const createSpherePolygonGeometry = (coordinates: number[][], radius: number): THREE.BufferGeometry => {
      let points: THREE.Vector3[] = []

      // Convert coordinates to 3D points
      const vertices = coordinates.map((coord: number[]) => latLongToVector3(coord[1], coord[0]))

      // Interpolate between each pair of points to form a denser set of vertices
      for (let i = 0; i < vertices.length; i++) {
         const nextIndex = (i + 1) % vertices.length
         points = points.concat(interpolatePoints(vertices[i], vertices[nextIndex], interpolationPrecision))
      }

      // Create geometry from points
      const shape = new THREE.Shape()
      points.forEach((point, idx) => {
         if (idx === 0) {
            shape.moveTo(point.x, point.y)
         } else {
            shape.lineTo(point.x, point.y)
         }
      })

      // Close the shape
      shape.lineTo(points[0].x, points[0].y)

      // Create geometry
      const geometry = new THREE.ShapeGeometry(shape)

      // Map vertices back to the sphere
      const position = geometry.getAttribute('position')
      const positionArray = position.array

      for (let i = 0; i < positionArray.length; i += 3) {
         const idx = i / 3
         const pointOnSphere = points[idx].clone().normalize().multiplyScalar(radius)
         positionArray[i] = pointOnSphere.x
         positionArray[i + 1] = pointOnSphere.y
         positionArray[i + 2] = pointOnSphere.z
      }

      position.needsUpdate = true
      geometry.computeVertexNormals()

      return geometry
   }

   const drawAreaOnSphere = (scene: THREE.Scene, coordinates: number[][], radius: number) => {
      const polygonGeometry = createSpherePolygonGeometry(coordinates, radius)
      const polygonMaterial = new THREE.MeshStandardMaterial({
         color: 0xff0000,
         side: THREE.DoubleSide,
         transparent: true,
         depthWrite: true,
         opacity: 0.1,
      })
      const polygonMesh = new THREE.Mesh(polygonGeometry, polygonMaterial)

      scene.add(polygonMesh)
   }


   // Interpolate points between coordinates
   const interpolatePoints = (start: THREE.Vector3, end: THREE.Vector3, steps: number): THREE.Vector3[] => {
      const points: THREE.Vector3[] = []
      for (let i = 0; i <= steps; i++) {
         const alpha = i / steps
         const interpolated = start.clone().lerp(end, alpha).normalize().multiplyScalar(EARTH_RADIUS)
         points.push(interpolated)
      }
      return points
   }


